/* initialize splash screen and poll for keyboard press*/
void splash(){
	*(pixel_ctrl_ptr + 1) = 0xC8000000; 
  	wait_for_vsync();
  	pixel_buffer_start = *pixel_ctrl_ptr;
	draw();

  	*(pixel_ctrl_ptr + 1) = 0xC0000000;
  	pixel_buffer_start = *(pixel_ctrl_ptr + 1); 
	draw();
	
	unsigned char byte1 = 0;
	unsigned char byte2 = 0;
	unsigned char byte3 = 0;
  	volatile int * PS2_ptr = (int *) 0xFF200100;  // PS/2 port address

	int PS2_data, valid;
	
	// spacebar implementation - could change to mouse
    // currently polling - could change to interrupt
    // after intro maybe have the option to select temp, voltage, or soc readings in live time
	while (1) {

		PS2_data = *(PS2_ptr);	// read the Data register in the PS/2 port
		valid = (PS2_data & 0x8000);	
		if (valid != 0)
		{
			byte1 = byte2;
			byte2 = byte3;
			byte3 = PS2_data & 0xFF;
		}

		if(byte3 == 0x29 &&  byte2 == 0xf0 && byte1 == 0x29){  // key detection
			program.state = CHARGING;  // change to second page
			break;
		}
	}		
		
	
}

void draw(){
	for(int y = 0; y < 240; y++){
		for(int x = 0; x < 320; x++){
			plot_pixel(x, y, program.background[y][x]);
		}
	}
}

void charging(){
	for (int y = 0 ; y < 240; y++)
	{
		for (int x = 0 ; x < 320; x++)
		{
			program.background[y][x] = chargingpage[y][x];
		}
	}
	*(pixel_ctrl_ptr + 1) = 0xC8000000; 
  	wait_for_vsync();
  	pixel_buffer_start = *pixel_ctrl_ptr;
	draw();

  	*(pixel_ctrl_ptr + 1) = 0xC0000000;
  	pixel_buffer_start = *(pixel_ctrl_ptr + 1); 
	draw();
	
}


void start_init(){
	program.state = INTRODUCTION;
	for (int y = 0 ; y < 240; y++)
	{
		for (int x = 0 ; x < 320; x++)
		{
			program.background[y][x] = splashpage[y][x];
		}
	}
}

void clear_screen(){
	for (int x = 0; x < 240; x++){
		for (int y = 0 ; y < 320; y++){
			plot_pixel(x, y, 0x0000);
		}
	}
}


void wait_for_vsync(){
	volatile int* pixel_ctrl_ptr= (int*) 0xFF203020;
	int status;
	*pixel_ctrl_ptr = 1;
	status = *(pixel_ctrl_ptr + 3);
	while((status & 0x01)!= 0){
		status = *(pixel_ctrl_ptr + 3);
	}
}

void mouse(){
    unsigned char byte1 = 0;
	unsigned char byte2 = 0;
	unsigned char byte3 = 0;
	
  	volatile int * PS2_ptr = (int *) 0xFF200100;  // PS/2 port address

	int PS2_data, RVALID;

	while (1) {
		PS2_data = *(PS2_ptr);	// read the Data register in the PS/2 port
		RVALID = (PS2_data & 0x8000);	// extract the RVALID field
		if (RVALID != 0)
		{
			/* always save the last three bytes received */
			byte1 = byte2;
			byte2 = byte3;
			byte3 = PS2_data & 0xFF;
		}
		if ( (byte2 == 0xAA) && (byte3 == 0x00) )
		{
			// mouse inserted; initialize sending of data
			*(PS2_ptr) = 0xF4;
		}
		// Display last byte on Red LEDs
		*RLEDs = byte3;
	}
}


